PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX wd: <http://www.wikidata.org/entity/>
SELECT ?partnerCount ( SUM( IF( ?gender = wd:Q6581072 , 1 , 0 ) ) AS ?femaleCount ) ( SUM( IF( ?gender = wd:Q6581097 , 1 , 0 ) ) AS ?maleCount ) WHERE {
  {
    SELECT ?person ?gender ( COUNT( ?partner ) AS ?partnerCount ) WHERE {
      ?person wdt:P106 ?occupation .
      VALUES ?occupation {
        wd:Q483501 wd:Q713200 wd:Q3391743 wd:Q639669 wd:Q191633 wd:Q266569 wd:Q674067
      }
      ?person wdt:P21 ?gender .
      FILTER ( ?gender IN ( wd:Q6581072 , wd:Q6581097 ) ) ?person wdt:P31 wd:Q5 .
      ?person wdt:P451 ?partner .
      FILTER NOT EXISTS {
        ?person wdt:P26 ?spouse .
      }
    }
    GROUP BY ?person ?gender
  }
}
GROUP BY ?partnerCount
ORDER BY ?partnerCount

