PREFIX wdt: <http://www.wikidata.org/prop/direct/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?person ?personLabel ?coordinates ?startDate ?endDate ( ( ?diffYears * 12 + ?diffMonths ) AS ?tenureMonths ) WHERE {
  ?person wdt:P31 wd:Q5 .
  ?person p:P106 ?stmt .
  ?stmt ps:P106 wd:Q3809586 .
  OPTIONAL {
    ?person wdt:P625 ?coordinates
  }
  .
  OPTIONAL {
    ?stmt pq:P580 ?startDate
  }
  .
  OPTIONAL {
    ?stmt pq:P582 ?endDate
  }
  .
  OPTIONAL {
    ?person rdfs:label ?personLabel .
    FILTER ( LANG( ?personLabel ) = "en" )
  }
  .
  FILTER ( BOUND( ?startDate ) ) BIND( IF( BOUND( ?endDate ) && isLiteral( ?endDate ) , ?endDate , NOW () ) AS ?end ) BIND( YEAR( ?end ) - YEAR( ?startDate ) AS ?diffYears ) BIND( MONTH( ?end ) - MONTH( ?startDate ) AS ?diffMonths )
}
ORDER BY ?personLabel
LIMIT 20

